import UserProfileC from "./UserProfile.module.css"

function UserProfile(props) {
    return (
        <div className="card">
            <span className={UserProfileC.name}>{props.Name}</span>
            <span className={UserProfileC.age}>{props.Age}</span>
            <span className={UserProfileC.avatarURL}>{props.URL}</span>
        </div>
    )
}

export default UserProfile
